import { Results } from "./PartyResultsStyles";

const PartyResults = ({ partyMorty, partyRick }: any) => {
  return (
    <div>
      <h1>PARTY</h1>
      <Results>
        <div>
          {partyRick ? (
            <img src={partyRick.image} alt={partyRick.name} />
          ) : (
            <span>RICK</span>
          )}
        </div>
        <div>
          {partyMorty ? (
            <img src={partyMorty.image} alt={partyMorty.name} />
          ) : (
            <span>MORTY</span>
          )}
        </div>
      </Results>
    </div>
  );
};

export default PartyResults;
